    var baseDomain = "paradise-moment.indino.co.uk";

    var loader;

    function preloader() {
        loader = new PxLoader();
        $('img').each(function() {
            var src = $(this).prop('src');
            loader.add(new PxLoaderImage(src));
        });


        loader.addProgressListener(function(e) {
            var percentage = parseInt((e.completedCount/e.totalCount)*100);
            // $('#loader span').text(percentage+'%');
            if (percentage === 100) {
                setTimeout (function(){
                    init();
                }, 0);
            }
            console.log(percentage);
        });

        loader.start();
    }

    function init() {

        var data = "initial";
        loaded();
        mainCardPostion(data);
        $('.js-start').on('click', start);
        $('.js-back').on('click', goBack);
        $('.js-main-card').on('click', showOption);
    //menu
        $('.js-open-menu').on('click', showMenu);
        $('.js-btn-close-menu').on('click', closeMenu);
        
        
        $('.js-show-hand').on('click', showHand);
        $('.js-next-intro').on('click', showNextStepIntro);
        $('.js-prev-intro').on('click', showPrevStepIntro);
        $('.js-next-rules').on('click', showNextStepRules);
        $('.js-prev-rules').on('click', showPrevStepRules);
        $('.js-next-tips').on('click', showNextStepTips);
        $('.js-prev-tips').on('click', showPrevStepTips);

        $('.js-next-hand').on('click', showNextHand);
        $('.js-prev-hand').on('click', showPrevHand);


        $('.js-tab-1').on('click', showTabSectionIntro);
        $('.js-tab-2').on('click', showTabSectionRules);
        $('.js-tab-3').on('click', showTabSectionTips);
        $('.js-stage-nav').on('click', showStage);
        $('.js-step-nav').on('click', showStep);
        $('.js-table-step').on('click', showTableStep);

        $(".nano, .nano-hands-menu").nanoScroller();
    }

//START LOADING

    function loaded() {
        mainCardHoverOn();
        menuCardHoverOn();
    }

//END

//HOVER CARD IN MENU 
	function menuCardHoverOn() {
		 $(".js-show-hand").on({
            mouseenter: hoverInMenuCard,
            mouseleave: hoverOutMenuCard
        });
	}

	function menuCardHoverOff() {
		 $(".js-show-hand").on({
            mouseenter: hoverInMenuCard,
            mouseleave: hoverOutMenuCard
        });
	}

	function hoverInMenuCard(e) {
       var current = $(e.currentTarget);
       for (var i = 1; i < 5; i++) {
            var card = $(current).find('.js-menu-card-'+i);
        	TweenMax.to(card, 0.3, {left:"-11"*i, ease:Power2.easeInOut}, 0);
       		TweenMax.to(current, 0.1, {x:"10", ease:Power0.easeNone}, 0);
        }
    }
    function hoverOutMenuCard(e) {
         for (var i = 1; i < 5; i++) {
            var card = $('.js-menu-card-'+i);
        	TweenMax.to(".js-menu-card-"+i, 0.3, {left:"0", ease:Power2.easeInOut});
        	TweenMax.to(".js-show-hand", 0.1, {x:"0", ease:Power0.easeNone});
        }
    }


//HOVER CARD
    function mainCardHoverOn(){
        $(".js-main-card").on({
            mouseenter: hoverInMainCard,
            mouseleave: hoverOutMainCard
        });
    }

    function mainCardHoverOff() {
        $(".js-main-card").off({
            mouseenter: hoverInMainCard,
            mouseleave: hoverOutMainCard
        });
    }

    function hoverInMainCard() {
        var glow = $(this).find('.js-glow');
        TweenMax.to(".js-main-card", 0.5, {scale:"0.9", opacity: "0.75", ease:Power2.easeInOut});
        TweenMax.to(this, 0.5, {scale:"1.1", opacity: "1", ease:Power2.easeInOut});
        TweenMax.to(glow, 0.5, {opacity:"0.75", ease:Power2.easeInOut});
    }
    function hoverOutMainCard(e) {
        if (!$(".js-main-card").hasClass('wrapped')) {
            scaleToInitial();
        } else {
            showOption(e);
        }
    }
//END


//OPTION LIST
    function toInitialMainCards() {
        // var rotateElem = $(".main-card-wrap");
        var faceup = $('.js-faceup');
        var facedown = $('.js-facedown');
        rotateToFaceDown(faceup, facedown);
        setTimeout (function(){
            scaleToInitial();
        },1000);
    }

//START function
    function start(e) {
        e.preventDefault();
        var current = $(e.currentTarget);
        var data = $(current).data('main_cards');
        toInitialMainCards();
        mainCardPostion(data);
        moveMainCardsCenter();
        removezIndex();
        current.addClass('hide');
        TweenMax.to(".js-start", 0.5, {opacity: "0", ease:Power2.easeInOut});
        $('.nav__flex-top').addClass('show');
        TweenMax.to(".nav__flex-top", 0.5, {opacity: "1", ease:Power2.easeInOut});
    }

    function goBack(e) {
        e.preventDefault();
        mainCardHoverOn();
        closeMenu();
        hideHandDesc();
        var current = $(e.currentTarget);
        var data = $(current).data('main_cards');
        toInitialMainCards();
        removeBackButton();
        $('.js-main-card').removeClass('wrapped');
        TweenMax.to(".js-main-card", 1.5, {scale:"1", opacity:"1", ease:Power2.easeInOut});
        setTimeout(function(){
            mainCardPostion(data);
            zoomInMainCards();
            moveMainCardsCenter();
        },750);
        setTimeout(function(){
            removezIndex();
        }, 2000);
        $('.js-game.active').removeClass('active');
        hideSection();
        hideTable();
        hideTabs();
        hideNavLine();

        $('.js-table-stage').removeClass('show');
        $('.js-table-step').removeClass('active');
        $('.js-table-step').removeClass('focus');
        TweenMax.to(".js-table-stage", 1, {opacity:"0", ease:Power2.easeInOut});

        removeActiveTab();
    }
    
    function removezIndex() {
        $('.js-main-card').removeClass('index');
    }
//END


//SHOW OPTION
    function showOption(e) {
        e.preventDefault();
        mainCardHoverOff();
        var current = $(e.currentTarget);
        var currentGameData = $(current).data("main_card");
        var currentGame = $('#'+currentGameData);

        var data = "initial";
        // var rotateElem = $(current).find('.main-card-wrap');
        mainCardPostion(data);
        moveMainCardsLeft();
        current.addClass('index');
        $(".js-main-card").addClass('wrapped');
        TweenMax.to(".js-main-card", 1, {scale:"0.85", ease:Power2.easeInOut});
        TweenMax.to(current, 1, {scale:"1.3", ease:Power2.easeInOut});
        // rotateToFaceUp(rotateElem);

        var faceup = $(current).find('.js-faceup');
        var facedown = $(current).find('.js-facedown');

        rotateToFaceUp(facedown, faceup);
        removeActiveMainCards();
        showBackButton();
//show game content
        $('#' + currentGameData).addClass('active');

        showIntro();
        showTabs();
        firstActiveTab();

    //change table images

    	gameImages(currentGameData);

    //text animation
    
        return false;
    }

    function firstActiveTab() {
    	var firstTab = $('.js-game.active').find('.js-tab:first-child');
    	firstTab.addClass('active');
    	TweenMax.to(firstTab, 0.5, {opacity:"1", scale:"1.1", ease:Power2.easeInOut});
    }

    function activeTab(tab) {
    	var siblings = $(tab).siblings('.js-tab');
    	siblings.removeClass("active");
    	TweenMax.to(siblings, 0.5, {opacity:"0.5", scale:"1", ease:Power2.easeInOut});
    	tab.addClass("active");
    	TweenMax.to(tab, 0.5, {opacity:"1", scale:"1.1", ease:Power2.easeInOut});
    }

    function removeActiveTab(){
    	$(".js-tab").removeClass('active');
    	TweenMax.to(".js-tab", 0.5, {opacity:"0.5", scale:"1", ease:Power2.easeInOut});

    }

//MAIN CARD POSITIONS
    function mainCardPostion(data) {
        var main_card = main_cards.filter(function ( main_card ) {
            return main_card.stage === data;
        })[0];

        for (var i = 1; i < 6; i++) {
            var left = main_card["main_card_"+i+"_left"]+"%";
            var top = main_card["main_card_"+i+"_top"]+"%";
            if ( data === "options" ) {
            	TweenMax.to('.main_card_' + i, 1.5, {x:left, y: top, ease:Power2.easeInOut, onComplete: showTitle});
            } else {
        		TweenMax.to('.js-card-title', 0.5, {bottom:"90%", opacity:"0"});    	
            	TweenMax.to('.main_card_' + i, 1.5, {x:left, y: top, ease:Power2.easeInOut});
            }
        }
    }

    //add title to the cards 
    function showTitle() {
     	TweenMax.fromTo('.js-card-title', 0.5, {bottom:"90%", opacity:"0"}, {bottom:"105%",opacity:"1"});
     	$('.main-cards').addClass('active');
    }
