    function positions(id){

    	if ($('#texas_holdem').hasClass('active')){
        	var table_card = game_1.filter(function ( table_card ) {
            	return table_card.id === id;
        	})[0];
        	var table_chip = chips_1.filter(function ( table_chip ) {
            	return table_chip.id === id;
        	})[0];

        } else if ($('#omaha').hasClass('active')) {
        	var table_card = game_2.filter(function ( table_card ) {
            	return table_card.id === id;
        	})[0];
        	var table_chip = chips_2.filter(function ( table_chip ) {
            	return table_chip.id === id;
        	})[0];

        } else if ($('#omaha_hi_lo').hasClass('active')) {
        	var table_card = game_3.filter(function ( table_card ) {
            	return table_card.id === id;
        	})[0];

        	var table_chip = chips_3.filter(function ( table_chip ) {
            	return table_chip.id === id;
        	})[0];

        }	else if ($('#seven_card_stud').hasClass('active')) {
        	var table_card = game_4.filter(function ( table_card ) {
            	return table_card.id === id;
        	})[0];

        	var table_chip = chips_4.filter(function ( table_chip ) {
            	return table_chip.id === id;
        	})[0];
        }	else if ($('#snap').hasClass('active')) {
        	var table_card = game_5.filter(function ( table_card ) {
            	return table_card.id === id;
        	})[0];
        	var table_chip = chips_5.filter(function ( table_chip ) {
            	return table_chip.id === id;
        	})[0];
        }

        for (var i = 1; i < 61; i++) {
        	var chip = $('#chip-' + i );
            var left = table_chip[i + "_left"] + "%";
            var top = table_chip[i + "_top"] + "%";
            
            TweenMax.to(chip, 1, {left:left, top: top, x: "-50%", y: "-50%", ease:Power2.easeInOut});

        //add classes from the table
    		chip.attr('class', 'chip ' + table_chip[i + "_status"]);

    		if ($(chip).hasClass('active')) {
    			chip.css({ "z-index": 32 + i });
    		} else {
    			chip.css({ "z-index": "0" });
    		}

    		if ($(chip).hasClass('fold')) {
    			TweenMax.to(chip, 1, {opacity: "0.01", ease:Power2.easeInOut});
    		} else {
    			TweenMax.to(chip, 1, {opacity: "1", ease:Power2.easeInOut});
    		}

        }

        for (var i = 1; i < 33; i++) {
            var card = $('#table__card-' + i );
            var left = table_card[i + "_left"] + "%";
            var top = table_card[i + "_top"] + "%";
            var rotate = table_card[i + "_turn"];



            
            TweenMax.staggerTo(card, 1, {left:left, top: top, rotation: rotate, x: "-50%", y: "-50%", ease:Power2.easeInOut},1);

        //add classes from the table
    		card.attr('class', 'table__card js-table-card ' + table_card[i + "_class"]);
    		
    		var faceup = $(card).find('.js-table-faceup');
    		var facedown = $(card).find('.js-table-facedown');
    		if ($(card).hasClass('rotate')) {
    			TweenMax.to(faceup, 1, {rotationY: "0", ease:Power2.easeInOut});
    			TweenMax.to(facedown, 1, {rotationY: "-180", ease:Power2.easeInOut});
    		} else {
    			TweenMax.to(faceup, 1, {rotationY: "180", ease:Power2.easeInOut});
    			TweenMax.to(facedown, 1, {rotationY: "0", ease:Power2.easeInOut});
    		}

    		if ($(card).hasClass('fold')) {
    			TweenMax.to(card, 1, {opacity: "0.05", ease:Power2.easeInOut});
    		} else if ($(card).hasClass('showdown')) {
    			TweenMax.to(card, 1, {opacity: "0.5", ease:Power2.easeInOut});
    		}
    		else {
    			TweenMax.to(card, 1, {opacity: "1", ease:Power2.easeInOut});
    		}

    		if ($(card).hasClass('active')) {
    			card.css({ "z-index": i });
    		} else {
    			card.css({ "z-index": "0" });
    		}
        }

        var dealer = $(".js-dealer");
        var dealerLeft = table_card["dealer_left"] + "%";
        var dealerTop = table_card["dealer_top"] + "%";

        TweenMax.to(dealer, 1, {left:dealerLeft, top: dealerTop, ease:Power2.easeInOut});


		var smallBlind = $(".js-small-blind");
        var smallBlindLeft = table_card["small_blind_left"] + "%";
        var smallBlindTop = table_card["small_blind_top"] + "%";

        TweenMax.to(smallBlind, 1, {left:smallBlindLeft, top: smallBlindTop, ease:Power2.easeInOut});
  		smallBlind.attr('class', 'table__position table__position--small_blind js-small-blind ' + table_card["small_blind_class"]);

        var bigBlind = $(".js-big-blind");
        var bigBlindLeft = table_card["big_blind_left"] + "%";
        var bigBlindTop = table_card["big_blind_top"] + "%";

        TweenMax.to(bigBlind, 1, {left:bigBlindLeft, top: bigBlindTop, ease:Power2.easeInOut});
    	bigBlind.attr('class', 'table__position table__position--big_blind js-big-blind ' + table_card["big_blind_class"]);

    	
    	var lowLimit = $(".js-low-limit");
        var lowLimitLeft = table_card["low_limit_left"] + "%";
        var lowLimitTop = table_card["low_limit_top"] + "%";

        TweenMax.to(lowLimit, 1, {left:lowLimitLeft, top: lowLimitTop, ease:Power2.easeInOut});
    	lowLimit.attr('class', 'table__position table__position--low_limit js-low-limit ' + table_card["low_limit_class"]);

    	var highLimit = $(".js-high-limit");
        var highLimitLeft = table_card["high_limit_left"] + "%";
        var highLimitTop = table_card["high_limit_top"] + "%";

        TweenMax.to(highLimit, 1, {left:highLimitLeft, top: highLimitTop, ease:Power2.easeInOut});
    	highLimit.attr('class', 'table__position table__position--high_limit js-high-limit ' + table_card["high_limit_class"]);

    }


